	(30,'0','2019苹果新品发布会：iPhone 11 Pro系列发布','陈功','image/content/2020/08/13/b1b14c22e72940ba96e0775fd0b4432cka3o1j1tlg.png','2019苹果新品发布会：iPhone 11 Pro系列发布','2019苹果新品发布会：iPhone 11 Pro系列发布','2019苹果新品发布会：iPhone 11 Pro系列发布','',0,'http://www.techweb.com.cn/ucweb/news/id/2753912',NULL,0,0,0,0,0,1,1,'<h1 class=\"title\" id=\"title\" style=\"margin: 0px; padding: 0px; text-align: center; font-size: 16px; line-height: 24px; color: rgb(33, 33, 33); overflow-wrap: break-word; font-family: &quot;Microsoft YaHei&quot;; white-space: normal;\">2019苹果新品发布会：iPhone 11 Pro系列发布</h1><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">2019年9月11日凌晨消息，苹果在美国旧金山新总部Apple Park的乔布斯剧院举行2019秋季新品发布会，苹果官方正式推出iPhone 11 Pro系列。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal; text-align: center;\"><img src=\"http://upload1.techweb.com.cn/s/320/2019/0911/1568162820990.jpg\" border=\"0\" alt=\"1\" style=\"margin: 0px; padding: 0px; border: none; max-width: 320px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">外观方面，iPhone 11 Pro系列是苹果第一支命名为Pro的手机，采用最先进的Pro Design，光学涂层和全新的配色（不锈钢的表面拥有磨砂的质感）iPhone 11 Pro机身三围144mm×71.4mm×8.1mm；iPhone 11 Pro Max机身三围158mm×77.8mm×8.1mm，包括深空灰银色和新的金色。iPhone 11 Pro采用5.8英寸屏（2436x1125分辨率），iPhone 11 Pro Max采用6.5英寸屏（2688x1242分辨率），iPhone 11 Pro系列的屏幕方面像素密度达到458ppi，支持广色域，峰值亮度竟然达到了1200 nit，支持HDR10和全景声。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal; text-align: center;\"><img src=\"http://upload1.techweb.com.cn/s/320/2019/0911/1568162828590.jpg\" border=\"0\" alt=\"2\" style=\"margin: 0px; padding: 0px; border: none; max-width: 320px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">硬件方面，iPhone 11 Pro系列搭载A13处理器，性能更强，芯片设计更加优秀；机器学习拥有更快的加速器，做矩阵乘法运算更快，速度是过去芯片产品的六倍。A13芯片拥有更低能耗的设计，采用了数量最多的晶体管，智能调度CPU使用，同时GPU功耗降低。续航方面，iPhone 11 Pro系列加入了很多省电的处理，只有在需要时，一些逻辑运算才会打开，iPhone 11 Pro每天的续航能力能够提升4小时，iPhone 11 Pro Max每天的续航能力能够提升5小时，同时支持18W快充。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal; text-align: center;\"><img src=\"http://upload1.techweb.com.cn/s/320/2019/0911/1568162839702.jpg\" border=\"0\" alt=\"3\" style=\"margin: 0px; padding: 0px; border: none; max-width: 320px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">摄像头方面，iPhone 11 Pro系列两款机型采用超广+广角+长焦三摄，其中超广端拥有120°视野，选用f/2.4光圈镜头；广角端，也就是主摄像头，依然是f/1.8光圈镜头，支持光学防抖和100%的对焦像素；长焦端则是f/2.0光圈，同样支持光学防抖，但对焦像素并不想主摄一样，全部可用。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal; text-align: center;\"><img src=\"http://upload1.techweb.com.cn/s/320/2019/0911/1568162849495.jpg\" border=\"0\" alt=\"4\" style=\"margin: 0px; padding: 0px; border: none; max-width: 320px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">A13仿生处理器的神经处理引擎为iPhone 11Pro系列提供了一个名为Deep Fusion的成像功能，简单说来依然是多帧合成，但合成张数更多，速度更快，它会在你按下快门前就捕捉八张“照片”，在最终按下快门生成一张正常曝光的照片之后，九张合成质量极佳的照片。看来这一次iPhone的HDR又要让人仰望了。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal; text-align: center;\"><img src=\"http://upload1.techweb.com.cn/s/320/2019/0911/1568162858790.jpg\" border=\"0\" alt=\"5\" style=\"margin: 0px; padding: 0px; border: none; max-width: 320px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">视频录制方面，录制过程中能够实时切换三个镜头端，并保持曝光、白平衡和色彩完全一致，无缝切换。如果你熟悉其他多摄像头手机，那么你就会明白，这个功能是多么地可怕。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">视频拍摄方面，支持4K视频拍摄、视频光学图像防抖功能 (广角和长焦)、2倍光学变焦等功能。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">又给Android世界的各位树了个标杆。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal; text-align: center;\"><img src=\"http://upload1.techweb.com.cn/s/320/2019/0911/1568162872389.jpg\" border=\"0\" alt=\"6\" style=\"margin: 0px; padding: 0px; border: none; max-width: 320px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">其他方面，iPhone 11 Pro系列均支持IP68级别防水防尘；续航方面，iPhone 11 Pro系列视频播放最长可达18小时，流媒体播放最长可达11小时，均支持无线充电，支持双卡双待（nano SIM卡），搭载全新发布的iOS13操作系统。</p><p style=\"margin-top: 0px; margin-bottom: 10px; padding: 0px; overflow-wrap: break-word; color: rgb(33, 33, 33); font-family: &quot;Microsoft YaHei&quot;; font-size: 12px; white-space: normal;\">售价方面，国行版iPhone 11 Pro 64G版本售价8699元，256GB版本售价9999元，512GB版本售价11799元；iPhone 11 Pro Max 64GB版本售价9599元，256GB版本售价10899元，512GB版本售价12699元，9月20日开售。</p><p><br/></p>','2020-08-15 09:20:18','2020-08-15 09:20:18');
